import React,{useState} from "react";
import './Registro.scss'
import { Link, useNavigate } from 'react-router-dom';
//import huellita from '../../assets/images/huellita.png';
import perrito from '../../assets/images/perrito.png';

function Registro(){
    const handelSubmit=(e)=>{
            e.preventDefault();
    }
    const[email, setemail]=useState('');
    const[name, setname]=useState('');
    const[pwd1, setpwd1]=useState('');
    const[pwd2, setpwd2]=useState('');
    const[cc, setcc]=useState('');
    const[ciudad, setciudad]=useState('');
    const[telf, settelf]=useState('');
    const[motivo, setmotivo]=useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
        let account = { email, name, pwd1, pwd2, cc, ciudad, telf, motivo }
        if (account) {
          console.log('account: ', account)
          // Redireccionar a la pÃ¡gina principal
          navigate('/');
        }
      }

    return(
        <div className="main-register">


            <div className="rigth-side">
                <div className="top-right">
                    <p className="top-right">Â¿Ya eres administrador? 
                    <Link id='links-sigin' to="/Login"> Inicia SesiÃ³n</Link>
                    </p>
                </div>
            
            <div className="body-right">
                    <div className="container">
                        
                        <h1 className="text">Â¡Gracias por querer ser parte de Huellitas de Esperanza!</h1>
                        <div className="img-class">
                           
                            <img src={perrito} id="perrito-id" alt=""  srcSet=""/>
                        </div>
                        <form onSubmit={handleSubmit}>
                        <div className="input-group">
                            <h5>Nombre Completo</h5>
                            <input type="text" name="Name" value={name} onChange={(e)=>{setname(e.target.value)}} id= "name"/>
                        </div>
                        <div className="input-group">
                            <h5>Correo elÃ©ctronico</h5>
                            <input type="email" name="email" value={email} onChange={(e)=>{setemail(e.target.value)}} id= "email1"/>
                        </div>
                        <div className="input-group">
                            <h5>ContraseÃ±a</h5>
                            <input type="password" name="pwd" value={pwd1} onChange={(e)=>{setpwd1(e.target.value)}} id= "pwd1"/>
                        </div>
                        <div className="input-group">
                            <h5>Confirmar contraseÃ±a</h5>
                            <input type="password" name="pwd" value={pwd2} onChange={(e)=>{setpwd2(e.target.value)}} id= "pwd2"/>
                        </div>
                       
                       
                        <div className="input-group">
                            <h5>CC/NIT</h5>
                            <input type="number" name="cc" value={cc} onChange={(e)=>{setcc(e.target.value)}} id= "cc"/>
                        </div>
                        
                        <div className="input-group">
                            <h5>Ciudad</h5>
                            <input type="text" name="ciudad" value={ciudad} onChange={(e)=>{setciudad(e.target.value)}} id= "ciudad"/>
                        </div>
                        <div className="input-group">
                            <h5>TelÃ©fono</h5>
                            <input type="number" name="telf" value={telf} onChange={(e)=>{settelf(e.target.value)}} id= "telf"/>
                        </div>
                        <div className="input-group">
                            <h5>Motivos por los que desea ser parte de la web</h5>
                            <input type="text" name="motivo" value={motivo} onChange={(e)=>{setmotivo(e.target.value)}} id= "motivo"/>
                        </div>
                            <input type="submit" id="sbtn" value="Enviar solicitud"></input>
                            <h4>RecibirÃ¡s un correo elÃ©ctronico confirmando su solicitud</h4>
                        </form>
                      
                    </div>
            </div>
            </div>
        </div>
    )
}

export default Registro;
